import React, { Component } from 'react'

export class Stock extends Component {
    render() {
        return (
            <div>
                <h1> STOCK </h1>
                <tr>
                    <th> Ticker </th>
                    <th> Volume </th>
                    <th> Time </th>
                {this.props.stock.map((accion) => (
                    <td> {accion.ticker} </td>
                ) )
                 };

                </tr>

            </div>
        )
    }
}

export default Stock
